import React from 'react';
import Header from './Header';
import './LoginPage.css';
import loginImg1 from '../assets/video/4065224-uhd_2160_4096_25fps.mp4'; // Replace with your own images
import loginImg2 from '../assets/video/'; // Replace with your own images
import { useNavigate } from 'react-router-dom';

const LoginPage = () => {
  const navigate = useNavigate();
  return (
    <>
      <Header />
      <div className="login-page-container">
        <div className="login-left">
          <h2>ENJOY THE BEST EXPERIENCE</h2>
          <p>Log in to enjoy a personalised experience and access all our services.</p>
          <button className="login-btn" onClick={() => navigate('/login/form')}>LOG IN</button>
          <button className="register-btn" onClick={() => navigate('/register')}>REGISTER</button>
        </div>
        <div className="login-right">
          <img src={loginImg1} alt="Login visual 1" className="login-img" />
          <img src={loginImg2} alt="Login visual 2" className="login-img" />
        </div>
      </div>
    </>
  );
};

export default LoginPage;
